import React from 'react';
import {Link} from 'react-router-dom';

const CvListItem = (props) => {

    const {cv} = props;

    return (
        <Link className="list-group-item list-group-item-action">
            {cv.name}/{cv.lastname}/{cv.email}/{cv.phone}
        </Link>
    );
};

export default CvListItem;
